import React from "react";
import Navlinks from "./Navlinks";

function Navbar (props) {
    return(
        <nav className="navbar bg-dark mb-5">
            <div className="container-fluid">
                <nav>
                    <img src="../images/SHARP-logo-white.svg" alt="Sharp Design Co." style="max-width: 175px; padding-top: 0px !important;"/>
                </nav>
                <ul className="navbar-nav">
                    <Navlinks hrefName="https://www.google.com" linkName="Google" />
                    <Navlinks hrefName="facebook.com" linkName="Facebook" />
                    <Navlinks hrefName="linkedin.com" linkName="LinkedIn" />
                </ul>
            </div>
        </nav>
    )
}

export default Navbar;
